/*Compute P = rhoRT/W(x) */
void CKPX(double * restrict rho, double * restrict T, double * restrict x, int * iwrk, double * restrict rwrk, double * restrict P)
{
    double XW = 0;/* To hold mean molecular wt */
    XW += x[0]*2.015940; /*H2 */
    XW += x[1]*1.007970; /*H */
    XW += x[2]*15.999400; /*O */
    XW += x[3]*31.998800; /*O2 */
    XW += x[4]*17.007370; /*OH */
    XW += x[5]*18.015340; /*H2O */
    XW += x[6]*33.006770; /*HO2 */
    XW += x[7]*34.014740; /*H2O2 */
    XW += x[8]*12.011150; /*C */
    XW += x[9]*13.019120; /*CH */
    XW += x[10]*14.027090; /*CH2 */
    XW += x[11]*14.027090; /*CH2(S) */
    XW += x[12]*15.035060; /*CH3 */
    XW += x[13]*16.043030; /*CH4 */
    XW += x[14]*28.010550; /*CO */
    XW += x[15]*44.009950; /*CO2 */
    XW += x[16]*29.018520; /*HCO */
    XW += x[17]*30.026490; /*CH2O */
    XW += x[18]*31.034460; /*CH2OH */
    XW += x[19]*31.034460; /*CH3O */
    XW += x[20]*32.042430; /*CH3OH */
    XW += x[21]*26.038240; /*C2H2 */
    XW += x[22]*27.046210; /*C2H3 */
    XW += x[23]*28.054180; /*C2H4 */
    XW += x[24]*29.062150; /*C2H5 */
    XW += x[25]*30.070120; /*C2H6 */
    XW += x[26]*41.029670; /*HCCO */
    XW += x[27]*42.037640; /*CH2CO */
    XW += x[28]*43.045610; /*CH2CHO */
    XW += x[29]*28.013400; /*N2 */
    XW += x[30]*19.022761; /*H3Op */
    XW += x[31]*29.017971; /*HCOp */
    XW += x[32]*43.045061; /*C2H3Op */
    XW += x[33]*33.049851; /*CH5Op */
    XW += x[34]*17.007919; /*OHn */
    XW += x[35]*15.999949; /*On */
    XW += x[36]*31.999349; /*O2n */
    XW += x[37]*60.009899; /*CO3n */
    XW += x[38]*61.017869; /*HCO3n */
    XW += x[39]*0.000549; /*E */
    *P = *rho * 8.31451e+07 * (*T) / XW; /*P = rho*R*T/W */

    return;
}


/*Compute P = rhoRT/W(y) */
void CKPY(double * restrict rho, double * restrict T, double * restrict y, int * iwrk, double * restrict rwrk, double * restrict P)
{
    double YOW = 0;/* for computing mean MW */
    YOW += y[0]*imw[0]; /*H2 */
    YOW += y[1]*imw[1]; /*H */
    YOW += y[2]*imw[2]; /*O */
    YOW += y[3]*imw[3]; /*O2 */
    YOW += y[4]*imw[4]; /*OH */
    YOW += y[5]*imw[5]; /*H2O */
    YOW += y[6]*imw[6]; /*HO2 */
    YOW += y[7]*imw[7]; /*H2O2 */
    YOW += y[8]*imw[8]; /*C */
    YOW += y[9]*imw[9]; /*CH */
    YOW += y[10]*imw[10]; /*CH2 */
    YOW += y[11]*imw[11]; /*CH2(S) */
    YOW += y[12]*imw[12]; /*CH3 */
    YOW += y[13]*imw[13]; /*CH4 */
    YOW += y[14]*imw[14]; /*CO */
    YOW += y[15]*imw[15]; /*CO2 */
    YOW += y[16]*imw[16]; /*HCO */
    YOW += y[17]*imw[17]; /*CH2O */
    YOW += y[18]*imw[18]; /*CH2OH */
    YOW += y[19]*imw[19]; /*CH3O */
    YOW += y[20]*imw[20]; /*CH3OH */
    YOW += y[21]*imw[21]; /*C2H2 */
    YOW += y[22]*imw[22]; /*C2H3 */
    YOW += y[23]*imw[23]; /*C2H4 */
    YOW += y[24]*imw[24]; /*C2H5 */
    YOW += y[25]*imw[25]; /*C2H6 */
    YOW += y[26]*imw[26]; /*HCCO */
    YOW += y[27]*imw[27]; /*CH2CO */
    YOW += y[28]*imw[28]; /*CH2CHO */
    YOW += y[29]*imw[29]; /*N2 */
    YOW += y[30]*imw[30]; /*H3Op */
    YOW += y[31]*imw[31]; /*HCOp */
    YOW += y[32]*imw[32]; /*C2H3Op */
    YOW += y[33]*imw[33]; /*CH5Op */
    YOW += y[34]*imw[34]; /*OHn */
    YOW += y[35]*imw[35]; /*On */
    YOW += y[36]*imw[36]; /*O2n */
    YOW += y[37]*imw[37]; /*CO3n */
    YOW += y[38]*imw[38]; /*HCO3n */
    YOW += y[39]*imw[39]; /*E */
    *P = *rho * 8.31451e+07 * (*T) * YOW; /*P = rho*R*T/W */

    return;
}


/*Compute P = rhoRT/W(y) */
void VCKPY(int * restrict np, double * restrict rho, double * restrict T, double * restrict y, int * iwrk, double * restrict rwrk, double * restrict P)
{
    double YOW[*np];
    for (int i=0; i<(*np); i++) {
        YOW[i] = 0.0;
    }

    for (int n=0; n<40; n++) {
        for (int i=0; i<(*np); i++) {
            YOW[i] += y[n*(*np)+i] * imw[n];
        }
    }

    for (int i=0; i<(*np); i++) {
        P[i] = rho[i] * 8.31451e+07 * T[i] * YOW[i]; /*P = rho*R*T/W */
    }

    return;
}


/*Compute P = rhoRT/W(c) */
void CKPC(double * restrict rho, double * restrict T, double * restrict c, int * iwrk, double * restrict rwrk, double * restrict P)
{
    int id; /*loop counter */
    /*See Eq 5 in CK Manual */
    double W = 0;
    double sumC = 0;
    W += c[0]*2.015940; /*H2 */
    W += c[1]*1.007970; /*H */
    W += c[2]*15.999400; /*O */
    W += c[3]*31.998800; /*O2 */
    W += c[4]*17.007370; /*OH */
    W += c[5]*18.015340; /*H2O */
    W += c[6]*33.006770; /*HO2 */
    W += c[7]*34.014740; /*H2O2 */
    W += c[8]*12.011150; /*C */
    W += c[9]*13.019120; /*CH */
    W += c[10]*14.027090; /*CH2 */
    W += c[11]*14.027090; /*CH2(S) */
    W += c[12]*15.035060; /*CH3 */
    W += c[13]*16.043030; /*CH4 */
    W += c[14]*28.010550; /*CO */
    W += c[15]*44.009950; /*CO2 */
    W += c[16]*29.018520; /*HCO */
    W += c[17]*30.026490; /*CH2O */
    W += c[18]*31.034460; /*CH2OH */
    W += c[19]*31.034460; /*CH3O */
    W += c[20]*32.042430; /*CH3OH */
    W += c[21]*26.038240; /*C2H2 */
    W += c[22]*27.046210; /*C2H3 */
    W += c[23]*28.054180; /*C2H4 */
    W += c[24]*29.062150; /*C2H5 */
    W += c[25]*30.070120; /*C2H6 */
    W += c[26]*41.029670; /*HCCO */
    W += c[27]*42.037640; /*CH2CO */
    W += c[28]*43.045610; /*CH2CHO */
    W += c[29]*28.013400; /*N2 */
    W += c[30]*19.022761; /*H3Op */
    W += c[31]*29.017971; /*HCOp */
    W += c[32]*43.045061; /*C2H3Op */
    W += c[33]*33.049851; /*CH5Op */
    W += c[34]*17.007919; /*OHn */
    W += c[35]*15.999949; /*On */
    W += c[36]*31.999349; /*O2n */
    W += c[37]*60.009899; /*CO3n */
    W += c[38]*61.017869; /*HCO3n */
    W += c[39]*0.000549; /*E */

    for (id = 0; id < 40; ++id) {
        sumC += c[id];
    }
    *P = *rho * 8.31451e+07 * (*T) * sumC / W; /*P = rho*R*T/W */

    return;
}


