    W += c[31]*29.017971; /*HCOp */
    W += c[32]*43.045061; /*C2H3Op */
    W += c[33]*33.049851; /*CH5Op */
    W += c[34]*17.007919; /*OHn */
    W += c[35]*15.999949; /*On */
    W += c[36]*31.999349; /*O2n */
    W += c[37]*60.009899; /*CO3n */
